// AddNewTask.js
import React, { useContext, useState } from 'react';
import TaskContext from './Context/TaskContext';
import '../App.scss';

function AddNewTask() {
    const { taskData, updateTaskData } = useContext(TaskContext);
    const [isPopupOpen, setIsPopupOpen] = useState(true);

    const closePopup = () => {
        setIsPopupOpen(false);
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        updateTaskData({ [name]: value });
    };

    return (
        <>
            {isPopupOpen && (
                <div className="popup__cover">
                    <div className="task__add">
                        <form className="task__card">
                            <div className="card__header">
                                <div className="imput__field">
                                    <label className="text__label" htmlFor="task-name">
                                        <img alt="pen" src="./Images/pen.svg" />
                                    </label>
                                    <input
                                        className="text__field title"
                                        type="text"
                                        id="task-name"
                                        name="taskName"
                                        value={taskData.taskName}
                                        onChange={handleInputChange}
                                        required
                                    />
                                </div>
                                <button
                                    className="card__button"
                                    type="button"
                                    onClick={closePopup}
                                ></button>
                            </div>
                            <div className="card__content">
                                <div className="imput__field">
                                    <p className="text__label date">Priority:</p>
                                    <input
                                        className="radio"
                                        type="radio"
                                        id="high"
                                        name="priority"
                                        value="high"
                                        checked={taskData.priority === 'high'}
                                        onChange={handleInputChange}
                                    />
                                    <label className="radio__label" htmlFor="high">High</label>

                                    <input
                                        className="radio"
                                        type="radio"
                                        id="mid"
                                        name="priority"
                                        value="mid"
                                        checked={taskData.priority === 'mid'}
                                        onChange={handleInputChange}
                                    />
                                    <label className="radio__label" htmlFor="mid">Medium</label>

                                    <input
                                        className="radio"
                                        type="radio"
                                        id="low"
                                        name="priority"
                                        value="low"
                                        checked={taskData.priority === 'low'}
                                        onChange={handleInputChange}
                                    />
                                    <label className="radio__label" htmlFor="low">Low</label>
                                </div>
                                <div className="date__field">
                                    <div className="imput__field">
                                        <label className="text__label date" htmlFor="deadline">
                                            Deadline:
                                        </label>
                                        <input
                                            className="text__field"
                                            type="date"
                                            id="deadline"
                                            name="deadline"
                                            value={taskData.deadline}
                                            onChange={handleInputChange}
                                        />
                                    </div>
                                </div>
                                <div className="imput__field">
                                    <label className="text__label" htmlFor="task-description">
                                        <img alt="pen" src="./Images/pen.svg" />
                                    </label>
                                    <textarea
                                        className="text__field description"
                                        id="task-description"
                                        name="description"
                                        value={taskData.description}
                                        onChange={handleInputChange}
                                        rows="10"
                                        cols="44.5"
                                    ></textarea>
                                </div>
                                <input
                                    className="button--generic"
                                    type="submit"
                                    defaultValue="Add Task"
                                />
                            </div>
                        </form>
                    </div>
                </div>
            )}
        </>
    );
}

export default AddNewTask;
